import React from "react";
import { Col, Row, Container } from "../components/Grid";
import Sound from "../components/Sound";

const SoundPage = () => {
  return (
      <Container fluid>
      <Sound></Sound>
      {fictionMode === true && (
        <div id="yT">
        <iframe  src="https://www.youtube.com/embed/bMVVMJbBPrs?start=1242">
        </iframe>
        </div>
      )}
    </Container>
  );
};

export default SoundPage;
